	,create_contents1: function() {
		var state_list = [];
		system_Cs2Hx.AddRange(state_list,this.G.state_list);
		state_list = SortUtil.Sort(state_list);
		var s = "";
		var _g = 0;
		while(_g < state_list.length) {
			var state = state_list[_g];
			++_g;
			var str = this.G.NEWLINECHAR;
			s += (state == null ? "" : state) + "," + (str == null ? "" : str);
		}
		this.m_contents1 = s;
	}
	,create_contents2: function() {
		var state_list = [];
		system_Cs2Hx.AddRange(state_list,this.G.state_list);
		state_list = SortUtil.Sort(state_list);
		var s = "";
		var _g = 0;
		while(_g < state_list.length) {
			var state = state_list[_g];
			++_g;
			var str = this.G.CreateFunc(state);
			var str1 = this.G.NEWLINECHAR;
			s += (str == null ? "" : str) + (str1 == null ? "" : str1);
		}
		this.m_contents2 = s;
	}
	,create_regex_contents: function(regex,macrobuf) {
		var state_list = [];
		system_Cs2Hx.ForEach(this.G.state_list,function(i) {
			var a = RegexUtil.Get1stMatch(regex,i);
			if(!(a == null || a.length == 0)) {
				state_list.push(i);
			}
		});
		state_list = SortUtil.Sort(state_list);
		var s = "";
		var _g = 0;
		while(_g < state_list.length) {
			var state = state_list[_g];
			++_g;
			var o = this.G.CreateFunc(state,macrobuf);
			if(!(o == null || o.length == 0)) {
				var str = this.G.NEWLINECHAR;
				s += (o == null ? "" : o) + (str == null ? "" : str);
			}
		}
		return s;
	}
