	,is_regex_contents_lc: function() {
		var match = RegexUtil.Get1stMatch(this.G.REGEXCONT,this.m_line);
		if(!(match == null || match.length == 0)) {
			var regex = HxOverrides.substr(system_Cs2Hx.Trim(match),2,null);
			regex = HxOverrides.substr(regex,0,regex.length - 2);
			var c = this.create_regex_contents(regex);
			var tmplines = StringUtil.ReplaceWordsInLine(this.m_line,match,c);
			system_Cs2Hx.AddRange(this.m_resultlist,tmplines);
			this.m_bContinue = true;
		}
	}
	,is_regex_contents2_lc: function() {
		var match = RegexUtil.Get1stMatch(this.G.REGEXCONT2,this.m_line);
		if(!(match == null || match.length == 0)) {
			var regex = RegexUtil.Get1stMatch("\\$\\/.+\\/->#",match);
			regex = HxOverrides.substr(regex,2,null);
			regex = HxOverrides.substr(regex,0,regex.length - 4);
			var macroname = RegexUtil.Get1stMatch("#.+\\$$",match);
			macroname = system_Cs2Hx.TrimEnd(macroname,[36]);
			var macrobuf = this.G.getMacroValueFunc(macroname);
			if(macrobuf == null || macrobuf.length == 0) {
				throw haxe_Exception.thrown(new system_SystemException("Macro is not defined. : " + (macroname == null ? "" : macroname)));
			}
			var c = this.create_regex_contents(regex,macrobuf);
			var tmplines = StringUtil.ReplaceWordsInLine(this.m_line,match,c);
			system_Cs2Hx.AddRange(this.m_resultlist,tmplines);
			this.m_bContinue = true;
		}
	}
