	,is_include_lc: function() {
		if(this.m_mw == null) {
			this.m_mw = new psggconverterlib_MacroWork();
		}
		this.m_mw.Init();
		this.m_mw.CheckMacro(this.m_line);
		if(this.m_mw.IsValid() && this.m_mw.IsInclude()) {
			var matchstr = this.m_mw.GetMatchStr();
			var file = this.m_mw.GetIncludFilename();
			var enc = this.m_mw.GetIncludeFileEnc();
			var text = IncludeFile.readfile(this.G,matchstr,file,enc);
			this.m_resultlist.push(this.G.GetComment(" #start include -" + (file == null ? "" : file)));
			var tmplines = StringUtil.ReplaceWordsInLine(this.m_line,matchstr,text);
			system_Cs2Hx.AddRange(this.m_resultlist,tmplines);
			this.m_resultlist.push(this.G.GetComment(" #end include -" + (file == null ? "" : file)));
			this.m_bContinue = true;
		}
	}
	,is_macro_lc: function() {
		if(this.m_mw.IsValid() && !this.m_mw.IsInclude()) {
			var matchstr = this.m_mw.GetMatchStr();
			var text = "";
			var macroname = this.m_mw.GetMacroname();
			if(macroname == null || macroname.length == 0) {
				text = "(error: macroname is null)";
			} else {
				text = this.G.getMacroValueFunc(macroname);
				if(text == null || text.length == 0) {
					text = "(error: no value for " + (macroname == null ? "" : macroname) + " )";
				} else {
					text = psggconverterlib_MacroWork.Convert(text,0,this.m_mw.GetArgValueList());
				}
			}
			var tmplines = StringUtil.ReplaceWordsInLine(this.m_line,matchstr,text);
			system_Cs2Hx.AddRange(this.m_resultlist,tmplines);
			this.m_bContinue = true;
		}
	}
